package jpegquality

import (
	"encoding/base64"
	"log"
	"os"
	"testing"
)

func init() {
	SetLogger(log.New(os.Stderr, "jpegq-test", log.Ltime|log.Lshortfile))
}

func TestJpegQuality(t *testing.T) {
	buf, err := base64.StdEncoding.DecodeString(jpegData)
	if err != nil {
		t.Fatal(err)
	}

	j, err := NewWithBytes(buf)
	if err != nil {
		t.Fatal(err)
	}
	q := j.Quality()
	t.Logf("jpeg quality %d", q)
	if q != 80 {
		t.Errorf("mismatch quality %d", q)
	}
}

const (
	jpegData = ``
)
